import React, { Component } from 'react';
import { Container, Row, Col, Card, CardBody } from 'reactstrap';
import { Link } from "react-router-dom";

//Import Images
import health from "../../images/icon/bitcoin.svg";
import termLife from "../../images/icon/bitcoin.svg";
import familyHealth from "../../images/icon/bitcoin.svg";
import investment from "../../images/icon/bitcoin.svg";
import car from "../../images/icon/bitcoin.svg";
import bike from "../../images/icon/bitcoin.svg";

class Contributing extends Component {
    constructor(props) {
        super(props);
        this.state={
            categories : [
                { img : health, title : "Health Insurance", link : "#" },
                { img : termLife, title : "Term Life Insurance", link : "#" },
                { img : familyHealth, title : "Family Health Insurance", link : "#" },
                { img : investment, title : "Investment Plans", link : "#" },
                { img : car, title : "4 Wheeler Insurance", link : "#" },
                { img : bike, title : "2 Wheeler Insurance", link : "#" },
            ]
        }
    }

    render() {
        return (
            <React.Fragment>
        <section>
            <Container>
                <Row className="mt-5 justify-content-center">
                    <Col lg={12}>
                        <div className="title-heading text-center">
                            <h1 className="heading title-dark text-dark mb-3">Landrick Insurance</h1>
                            <p className="para-desc mx-auto text-dark">Launch your campaign and benefit from our expertise on designing and managing conversion centered bootstrap4 html page.</p>

                            <Row className="mt-4 pt-2">
                                {
                                    this.state.categories.map((category, key) =>
                                        <Col key={key} lg={2} md={4} xs={6} className="mt-4 pt-2">
                                            <Card className="explore-feature border-0 rounded text-center bg-white">
                                                <CardBody>
                                                    <div className="icon rounded-circle shadow-lg d-inline-block">
                                                        <img src={category.img} className="avatar avatar-md-sm" alt="Landrick" />
                                                    </div>
                                                    <div className="content mt-3">
                                                        <h6 className="mb-0"><Link to={category.link} className="title text-dark">{category.title}</Link></h6>
                                                    </div>
                                                </CardBody>
                                            </Card>
                                        </Col>
                                    )
                                }
                            </Row>
                        </div>
                    </Col>
                </Row>
            </Container>
        </section>
        <div className="position-relative">
            <div className="shape overflow-hidden text-white">
                <svg viewBox="0 0 2880 48" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M0 48H1437.5H2880V0H2160C1442.5 52 720 0 720 0H0V48Z" fill="currentColor"></path>
                </svg>
            </div>
        </div>
            </React.Fragment>
        );
    }
}

export default Contributing;
